// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./Store.sol";

contract TokenStaking is Ownable, Store {
    using Math for uint256;

    constructor(
        address _tokenAddress,
        uint256 _rewardRate,
        uint256 _lockinTime
    ) Ownable(msg.sender) {
        token = IERC20(_tokenAddress);
        REWARD_RATE = _rewardRate;
        LOCKIN_TIME = _lockinTime;
    }

    function stake(uint256 _amount) external {
        require(_amount > 0, "Amount must be greater than zero");
        require(token.balanceOf(msg.sender) >= _amount, "Insufficient balance");
        require(
            token.allowance(msg.sender, address(this)) >= _amount,
            "insufficient Allowance"
        );
        token.transferFrom(msg.sender, address(this), _amount);
        stakedAmounts[msg.sender].push(
            Stake({
                amount: _amount,
                addTime: block.timestamp,
                lastUpdateTime: block.timestamp
            })
        );

        emit Staked(msg.sender, _amount);
    }

    function unstake(uint256 _index) external {
        uint256 amount = stakedAmounts[msg.sender][_index].amount;
        uint256 addedTime = stakedAmounts[msg.sender][_index].addTime;
        require(amount > 0, "Insufficient amout to withdraw");
        require(
            addedTime + LOCKIN_TIME <= block.timestamp,
            "Lock in period not compleated"
        );
        require(amount > 0, "No tokens staked");
        uint256 reward = calculateReward(msg.sender, _index);
        (, uint256 totalAmount) = amount.tryAdd(reward);
        delete stakedAmounts[msg.sender][_index];
        token.transfer(msg.sender, totalAmount);
        emit Unstaked(msg.sender, amount, reward);
    }

    function calculateReward(
        address _user,
        uint256 _index
    ) public view returns (uint256) {
        uint256 amount = stakedAmounts[_user][_index].amount;
        (, uint256 timeElapsed) = block.timestamp.trySub(
            stakedAmounts[_user][_index].addTime
        );
        (, uint256 a) = amount.tryMul(REWARD_RATE);
        (, uint256 b) = a.tryMul(timeElapsed);
        (, uint256 c) = b.tryDiv(100);
        (, uint256 reward) = c.tryDiv(1 weeks);
        return reward;
    }

    function setRewardRate(uint256 _newRate) external onlyOwner {
        require(_newRate > 0, "Reward rate must be greater than zero");
        REWARD_RATE = _newRate;
    }

    function setLockInTime(uint256 _newLockInTime) external onlyOwner {
        require(_newLockInTime >= 0, "Lock in time cannot be negative");
        LOCKIN_TIME = _newLockInTime;
    }
}

contracts/StakingAndDivident.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./Staking.sol";

contract StakingAndDivident is Ownable, TokenStaking {
    constructor(
        IERC20 _usdtToken,
        address _tokenAddress,
        uint256 _StakingRewardRate,
        uint256 _lockinTime
    ) TokenStaking(_tokenAddress, _StakingRewardRate, _lockinTime) {
        usdtToken = _usdtToken;
    }

    function claimDivident(uint256 _index) public {
        Stake memory userStake = stakedAmounts[msg.sender][_index];
        require(userStake.amount > 0, "No stake available");
        require(
            userStake.lastUpdateTime + LOCKIN_TIME <= block.timestamp,
            "Lock time is not over"
        );
        uint256 dividentReward = _calculateReward();
        require(
            usdtToken.balanceOf(address(this)) >= dividentReward,
            "Not enough balance to provide divident"
        );
        usdtToken.transfer(msg.sender, dividentReward);
        stakedAmounts[msg.sender][_index].lastUpdateTime = block.timestamp;
        emit ClaimDivident(msg.sender, userStake.amount, dividentReward);
    }

    function calculateDividentReward(
        address _user,
        uint256 _index
    ) public view returns (uint256) {
        Stake memory userStake = stakedAmounts[_user][_index];
        require(
            userStake.lastUpdateTime + LOCKIN_TIME <= block.timestamp,
            "Lock time is not over"
        );
        uint256 dividentReward = _calculateReward();
        return dividentReward;
    }

    function _calculateReward() internal view returns (uint256) {
        uint256 etherPresent = address(this).balance;
        uint256 usdtPresent = usdtToken.balanceOf(address(this));
        uint256 tokenTotalSupply = token.totalSupply();
        uint256 divident = (usdtPresent + etherPresent) / tokenTotalSupply;
        require(divident > 0, "Divident is 0");
        return divident;
    }

    function withdrawUsdt(address _to) external onlyOwner {
        require(
            usdtToken.balanceOf(address(this)) > 0,
            "No Tokenavailable to withdraw"
        );
        usdtToken.transfer(_to, usdtToken.balanceOf(address(this)));
    }

    function withdrawEther(address _to) external onlyOwner {
        require(address(this).balance > 0, "No Ether available to withdraw");
        (bool success, ) = _to.call{value: address(this).balance}("");
        if (!success) {
            revert("Transfer failed");
        }
    }
}

contracts/Store.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/Math.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Store {
    using Math for uint256;

    IERC20 public token;
    IERC20 public usdtToken;
    uint256 public REWARD_RATE;
    uint256 public LOCKIN_TIME;

    struct Stake {
        uint256 amount;
        uint256 addTime;
        uint256 lastUpdateTime;
    }

    mapping(address => Stake[]) public stakedAmounts;

    event ClaimDivident(address indexed user, uint256 amount, uint256 reward);
    event Staked(address indexed user, uint256 amount);
    event Unstaked(address indexed user, uint256 amount, uint256 reward);
}

